import React, { useState } from 'react'
import '../App.css'
import lupa from '../assets/ic_Search.png'
import mlbrand from '../assets/Logo_ML.png'

export default function SearchBar() {
    const [search, setSearch] = useState("");

    const onSubmit = e => {
        setSearch(e.target.value)
    }

    return (
        <div className="search-bar">
            <img id="meli-brand-logo" src={mlbrand} alt="logo" />
            <form id="input-with-btn">
                <input type="text" className="inputspace" value={search} onChange={() => setSearch(searc)} placeholder="Nunca dejes de buscar" />
                <button type="submit" onSubmit={() => onSubmit()}>
                    <img src={lupa} alt="lupa" />
                </button>
            </form>
        </div>
    )
}
